import { useState } from "react";
import { SuperHero } from "../types";
import ToggleImages from "./ToggleImages";

interface SuperheroDetail {
  superheroInfo: SuperHero;
}

function SuperheroDetails(props: SuperheroDetail) {
  const superheros = props.superheroInfo;

  const [active, setActive] = useState(false);

  const handleChangeActive = () => {
    setActive((previousStar) => {
      return !previousStar;
    });
  };

  return (
    <>
      <div className="test">
        <ToggleImages active={active} handleChangeActive={handleChangeActive} />

        <img className="active" src={Active} alt="yellow star" />

        <img className="inactive" src={Inactive} alt="black and white star" />

        <h2>{superheros.name}</h2>
        <p>{superheros.description}</p>
      </div>
    </>
  );
}

export default SuperheroDetails;
